import { BaseCustomWebComponentConstructorAppend, css, html } from '@node-projects/base-custom-webcomponent';
export class ZplDemoView extends BaseCustomWebComponentConstructorAppend {
    static template = html `<iframe id="iframe"></iframe>`;
    static style = css `
        :host {
            display: block;
            overflow: hidden;
            background: white;
            height: 100%;
            width: 100%;
            position: relative;
        }
        iframe {
            height: 100%;
            width: 100%;
        }`;
    constructor() {
        super();
    }
    executeCommand;
    canExecuteCommand;
    dispose() { }
    async display(serviceContainer, instanceServiceContainer, code, style) {
        const url = "http://labelary.com/viewer.html?zpl=" + encodeURIComponent(code);
        this._getDomElement('iframe').src = url;
    }
}
customElements.define('node-projects-zpl-demo-view', ZplDemoView);
